import React, { Component } from 'react';
import About from '../components/About';
import CardsProject from '../components/CardsProject';
import Footer from '../components/Footer';
import Header from '../components/Header';
import CardsSkills from '../components/CardsSkills';
import { projectsPI, techs, skills } from '../db';
import '../components/css/Skills.css'

class InitialPage extends Component {
  render() {
    return (
    <>
      <Header />
      <About />
      <section className="boxSkills fadein">
        <div className="boxTech">
          <h4 className="tamanhoc" id="conhecimento"><strong>Conheça meus projetos:</strong></h4>        
          <CardsProject data={ projectsPI } />
        </div>
      </section>
      <section className="boxSkills fadein">
        <div className="boxTech">
          <h4 className="tamanhoc" id="conhecimento"><strong>Tenho conhecimento em:</strong></h4>      
            <CardsSkills data={ techs } />
        </div>
        <div className="boxTech">
          <h4 className="tamanhoc" id="estudo"><strong>Atualmente estudo na @betrybe os conteúdos de:</strong></h4>
          <div className="boxTech">
            <CardsSkills data={ skills } />
          </div>
        </div>
      </section>
      <Footer />
    </>
  )
  }
}

export default InitialPage;
